import React, { Component } from 'react';
import ReactMapGL from 'react-map-gl';

export default class Gmap extends Component {
  state = {
      viewport: {
          width: "100vw",
          height: "100vh",
          latitude: 21.0244246,
          longitude: 105.7938072,
          zoom: 16
      }
  };

  render() {
    return (
      <div className="App">
        <div className="App-content">
          <ReactMapGL {...this.state.viewport} mapStyle="mapbox://styles/mapbox/streets-v11"
		  	onViewportChange={(viewport => this.setState(viewport))}
            mapboxApiAccessToken="pk.eyJ1IjoidG9hbmRvIiwiYSI6ImNrbThscTh4cjBrNnQycHF5MWJqd29jaDQifQ.LNubsbmqGfZhCCRymL-A2g">
          </ReactMapGL>
        </div>
      </div>
    );
  }
}
